  return function (targetClassPrototype: object, name: string | symbol) {
    Object.defineProperty(targetClassPrototype.constructor, "level", {
      configurable: true,
      writable: true,
      enumerable: false,
      value: function () {
        console.log("param", param);
      },
    });
  };
}

class CustomerServeice {
